package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import static org.mockito.Mockito.*;
import static org.junit.jupiter.api.Assertions.*;
import java.util.List;
import java.util.Optional;

@ExtendWith(MockitoExtension.class)
class PetControllerTest {

	@Mock
	private OwnerRepository owners;

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetController controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns the collection of pet types when findPetTypes is called")
	void testPopulatePetTypesReturnsCollection() {
		List<PetType> petTypes = List.of(new PetType(), new PetType());
		when(types.findPetTypes()).thenReturn(petTypes);
		var result = controller.populatePetTypes();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns an empty collection when no pet types exist")
	void testPopulatePetTypesReturnsEmptyCollection() {
		when(types.findPetTypes()).thenReturn(List.of());
		var result = controller.populatePetTypes();
		assertEquals(List.of(), result);
	}

	@Test
	@DisplayName("Returns the owner when a valid owner ID is provided")
	void testFindOwnerWithValidId() {
		Owner testOwner = new Owner();
		when(owners.findById(1)).thenReturn(Optional.of(testOwner));
		var result = controller.findOwner(1);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws exception when owner ID does not exist")
	void testFindOwnerWithInvalidId() {
		when(owners.findById(999)).thenReturn(Optional.empty());
		assertThrows(IllegalArgumentException.class, () -> {
			controller.findOwner(999);
		});
	}

}
